export const Default = () => {
  return (
    <div>
      <p className="min-h-screen text-4xl flex flex-col  m-auto font-extrabold text-transparent bg-clip-text bg-gradient-to-br from-blue-200 to-sky-800 mt-4 p-12">SpaceX designs, manufactures and launches advanced rockets and spacecraft.<br>
      </br>The company was founded in 2002 to revolutionize space technology, with the ultimate goal of enabling people to live on other planets.</p>
    </div>
  )
}
